(15523, 'doi:9781000205992', '', '', 'Rulers of Literary Playgrounds; Politics of Intergenerational Play in Children? Literature', '0101-01-01 00:00:00', '', 'Rulers of Literary Playgrounds: Politics of Intergenerational Play in Children? Literature offers multifaceted reflection on interdependences between children and adults as they engage in play in literary texts and in real life. This volume brings together international children? literature scholars who each look at children? texts as key vehicles of intergenerational play reflecting ideologies of childhood and as objects with which children and adults interact physically, emotionally, and cognitively. Each chapter applies a distinct theoretical approach to selected children? texts, including individual and social play, constructive play, and play deprivation. This collection of essays constitutes a timely voice in the current discussion about the importance of children? play and adults·contribution to it vis-·vis the increasing limitations of opportunities for children? playful time in contemporary societies.', NULL, 'https://doi.org/9781000205992', '2025-11-05 03:47:00', ''),
