(15535, '', '', '', 'Challenges to the Fight against Rabies?he Landscape of Policy and Prevention Strategies in Africa', '0101-01-01 00:00:00', '', 'Nearly 59, 000 human deaths worldwide are attributable to rabies annually, of which more than a third occur in Africa. In recent years, progress has been made in both action and collaboration including implementation of surveillance and prevention measures. In this review we assess the scale of surveillance, Preventive, and control efforts of canine-transmitted human rabies in African countries. We reviewed literature published from 2014 to 2018, retrieved from electronic databases including MEDLINE, Global Index Medicus, BIOSIS, Science Citation Index, and EMBASE. WHO reports, national disease control program reports, and conference proceedings were also reviewed. The database search was conducted using keywords including rabies, control, and prevention. In forty countries (40/54), some level of rabies control and prevention strategy was available while in fourteen (14/54) countries, no specific national control and prevention strategy for human rabies could be retrieved. Thirty-four (34/54) countries utilized the Stepwise Approach towards Rabies Elimination (SARE) tool to monitor the national rabies control efforts?ive of these countries were at the lowest tier (0/5) of the SARE scoring system while no country had achieved the highest score (5/5). High burden countries need to step up the implementation of context specific national rabies control, prevention, and monitoring strategies. As a zoonosis, rabies control and elimination require coordination between human and veterinarian health sectors under the ?ne Health·umbrella and with national master plans on the prevention and control of neglected tropical diseases ending in 2020, the time to act is now., rabies; zoonoses; prevention; Africa', NULL, NULL, '2025-11-05 03:47:00', ''),
(15536, '', '', '', 'Biosystems Diversity', '0101-01-01 00:00:00', '', 'Regulatory Mechanisms, Biosystems', NULL, NULL, '2025-11-05 03:47:00', ''),
(15537, '', '', '', 'Current Status of Rabies and Its Eradication in Eastern and Southeastern Europe', '0101-01-01 00:00:00', '', 'The objective of this paper is to provide an overview of the current status of rabies in Europe, with special emphasis on Croatia and Southeast and East Europe. Due to the systematic implementation of a rabies eradication program by oral vaccination of wild animals, by the end of the 20th century, most West and Central European countries were rabies-free. The EU goal was to eradicate rabies in wildlife and domestic animals by 2020. No matter how achievable the goal seemed to be, the disease is still present in the eastern part of the EU, as was notified in 2020 by two member states?oland and Romania. Croatia has been rabies-free for the last seven years but given that it borders a non-EU country in which a case of rabies was confirmed in 2020, it will continue to contribute to the maintenance of the rabies-free region. A rabies-free EU can only be achieved by continuous oral vaccination, coordination and a regional approach. The prevention of reintroductions from bordering countries in which rabies has not been eradicated yet, and the support for the eradication efforts made by these countries, are goals still pending., sylvatic rabies; Croatia; Southeast Europe; oral rabies vaccination (ORV); bat rabies', NULL, NULL, '2025-11-05 03:47:00', ''),
