(15691, '', '', '', 'Optimization of Bokashi-Composting Process Using Effective Microorganisms-1 in Smart Composting Bin', '0101-01-01 00:00:00', '', 'Malaysians generate 15, 000 tons of food waste per day and dispose of it in the landfill, contributing to greenhouse gas emissions. As a solution for the stated problem, this research aims to produce an excellent quality bokashi compost from household organic waste using a smart composting bin. The bokashi composting method is conducted, whereby banana peels are composted with three types of bokashi brans prepared using 12, 22, and 32 mL of EM-1 mother cultured. During the 14 days composting process, the smart composting bin collected the temperature, air humidity, and moisture content produced by the bokashi-composting process. With the ATmega328 microcontroller, these data were uploaded and synchronized to Google Sheet via WIFI. After the bokashi-composting process was completed, three of each bokashi compost and a control sample were buried in separate black soil for three weeks to determine each compost? effectiveness. NPK values and the C/N ratio were analyzed on the soil compost. From the research, 12 mL of EM-1 shows the most effective ratio to the bokashi composting, as it resulted in a faster decomposition rate and has an optimum C/N ratio. Bokashi composting can help to reduce household food wastes. An optimum amount of the EM-1 used during the bokashi-composting process will produce good quality soil without contributing to environmental issues., bokashi composting; smart composting bin; WIFI; IoT', NULL, NULL, '2025-11-05 03:47:00', ''),
