(15713, '', '', '', 'Readymade Solutions and Students·Appetite for Plagiarism as Challenges for Online Learning', '0101-01-01 00:00:00', '', 'In the context of the COVID-19 pandemic, the importance of online learning has increased. Inherently, the stakes of a sustainable approach to the challenges raised by the wide access to the Internet, the use of readymade solutions to meet didactical tasks, and students·appetite for plagiarism have become higher. These challenges can be sustainably managed via a procedure aimed at constructively converting students·appetite for plagiarism (SAP conversion) into a skill of critically approaching relevant materials that are available online. The solutions proposed by the specialized literature concerned with the problem of plagiarism can be grouped into five categories: better trained students, more involved teachers, the use of anti-plagiarism software, clear anti-plagiarism policies, and ethical education of the youths. The SAP conversion procedure is a solution targeting increased involvement on behalf of teachers. Its partial application in the case of the disciplines included in the undergraduate educational program of Sociology conducted by the Transylvania University of Brasov, where students·evaluation is based on essays, has considerably decreased the amount of student plagiarism., Internet; students; plagiarism; readymade solutions, Readymade Solutions, Student\'s Appetite for Plagiarism as Challenges for Online Learning', NULL, NULL, '2025-11-05 03:47:00', ''),
