(16184, 'doi:9781351002387', '', '', 'Women? Health and the Limits of Law; Domestic and International Perspectives', '0101-01-01 00:00:00', '', 'Despite some significant advances in the creation and protection of rights affecting women? health, these do not always translate into actual health benefits for women. This collection asks: ?hat is an effective law and what influences law? effectiveness or ineffectiveness? What dynamics, elements and conditions come together to limit law? capacity to achieve instrumental goals for women? health and the advancement of women? health rights?·The book presents an integrated, co-referential and sustained critical discussion of the normative and constitutive reasons for law? limited effectiveness in the field of women? health. It offers comprehensive and cohesive explanatory accounts of law? limits and, for the first time in the field, introduces a distinction between Formal and Substantive Effectiveness of laws. Its approach is trans-systemic, multi-jurisdictional and comparative, with a focus on six countries in North America, Europe, Asia and Africa and international human rights case law based on matters arising from Hungary, Portugal, Spain, Slovakia, the Czech Republic, Peru and Bolivia.', NULL, 'https://doi.org/9781351002387', '2025-11-05 03:47:00', ''),
(16185, 'doi:9781351035620', '', '', 'Routledge International Handbook of Women? Sexual and Reproductive Health; First Edition', '0101-01-01 00:00:00', '', 'The Routledge International Handbook of Women? Sexual and Reproductive Health is the authoritative reference work on important, leading-edge developments in the domains of women? sexual and reproductive health.', NULL, 'https://doi.org/9781351035620', '2025-11-05 03:47:00', ''),
