(17717, '', '', '', 'Toolkit for Building Disaster-Resilient School Communities in Southeast Asia', '0101-01-01 00:00:00', '', 'Education in emergencies (EiE) and disaster risk reduction and management (DRRM) is one of the 10 collaborative projects of the 11 SEAMEO Member Countries for reaching the unreached to achieve Education for All (EFA) by 2015. It was approved in April 2009 during the 44th SEAMEO Council Conference which had as participants 10 international non-government organizations (INGOs) and EFA partners, including SEAMEO INNOTECH. In this joint commitment, the Center? contribution is a toolkit on building disasterresilient school communities under the SEAMEO INNOTECH Regional Education Program (SIREP). This toolkit is designed for high-risk school communities in Southeast Asia within the context of education for sustainable development (ESD). It presents important key concepts and examples on disaster risk reduction and the strategic action taken by SEAMEO Member Countries in integrating these in education and local governance. It is intended for school heads and teachers to help them coordinate, setup, maintain and sustain effective DRRM programs in their respective school communities. It captures the life-giving stories and innovations on school-based DRRM in Southeast Asia into one learning resource package, the end goal of which is to develop disaster-resilient schools communities.', NULL, NULL, '2025-11-05 03:47:00', ''),
