(20432, '', '', '', 'The potato crop : its agricultural, nutritional and social contribution to humankind', '0101-01-01 00:00:00', '', 'This book is open access under a CC BY 4.0 license. This book provides a fresh, updated and science-based perspective on the current status and prospects of the diverse array of topics related to the potato, and was written by distinguished scientists with hands-on global experience in research aspects related to potato. The potato is the third most important global food crop in terms of consumption. Being the only vegetatively propagated species among the world\'s main five staple crops creates both issues and opportunities for the potato: on the one hand, this constrains the speed of its geographic expansion and its options for international commercialization and distribution when compared with commodity crops such as maize, wheat or rice. On the other, it provides an effective insulation against speculation and unforeseen spikes in commodity prices, since the potato does not represent a good traded on global markets. These two factors highlight the underappreciated and underrated role of the potato as a dependable nutrition security crop, one that can mitigate turmoil in world food supply and demand and political instability in some developing countries. Increasingly, the global role of the potato has expanded from a profitable crop in developing countries to a crop providing income and nutrition security in developing ones. This book will appeal to academics and students of crop sciences, but also policy makers and other stakeholders involved in the potato and its contribution to humankind\'s food security., Potatoes', NULL, NULL, '2025-11-05 03:50:05', ''),
