(20434, 'isbn:978-979-433-773-8', '', '', 'THE RISE OF NINE', '0101-01-01 00:00:00', '', '<div>Sebelum bertemu Nomor Empat, aku sendirian. Dalam pelarian, aku bersembunyi dan berjuang untuk bertahan.<div>Sekarang, kami mulai berkumpul. Satu demi satu. Bersama, kami semakin kuat, meski mantra pelindung terpecahkan dan Mogadorian bisa menghabisisi kami tanpa harus sesuai urutan. Tetapi, kami terpaksa berpisah untuk menemukan yang lain...</div><div>Aku ke Spanyol, menemukan Nomor Tujuh dan Nomor Sepuluh. John bertualang dengan Nomor Sembilan memburu Setrakus Ra, pembunuh para Garde. Kini, kami berpencar mencari yang lain ke seluruh penjuru dunia. Tetapi Mogadorian juga mencari, dengan cara apapun...</div><div>Mereka membunuh Nomor Satu di Malaysia. Nomor Dua di Inggris dan Nomor Tiga di Kenya. Mereka menangkapku di New York, tetapi aku berhasil lari. Mereka ingin menghabisi kami, tapi mereka harus berhadapan dengan kami terlebih dahulu, Pewaris Pusaka Lorien.</div></div>, Novel, fiksi, remaja, dewasa', NULL, NULL, '2025-11-05 03:50:05', ''),
