(20597, '', '', '', 'Measures Acted Upon by the House of Representatives: 18th Congress, First and Second Regular Meeting', '0101-01-01 00:00:00', '', 'The year 2020 proved to be one of the most challenging years in history, not only for the Philippines but on a global scale. The Taal Volcano eruption, the COVID-19 pandemic, the continued incidence of the African Swine Fever (ASF) that weakened the hog industry, and a series of strong typhoons that hit the country, all contributed to the closing of businesses, loss of income, and disruptions in the food supply chain. The country\'s gross domestic product shrank 9.5% in 2020. This was the first annual contraction in 22 years since 1998, a year after the Asian financial crisis erupted, the Philippine Statistics Authority (PSA) reported. Agriculture output, which contributes about a tenth to gross domestic product (GDP) and a fourth of the country? jobs, decreased by 1.2% in 2020, a reversal from the 0.3% growth in 2019. This was also the first time the agricultural output saw an annual decline since 2016? -1.5%.', NULL, NULL, '2025-11-05 03:50:05', ''),
