(23405, '', '', '', 'The Subtle Art of Not Giving a F*ck', '0101-01-01 00:00:00', '', 'In this generation-defining self-help guide, a superstar blogger cuts through the crap to show us how to stop trying to be \"positive\" all the time so that we can truly become better, happier people.\r\nFor decades, we\'ve been told that positive thinking is the key to a happy, rich life. \"F**k positivity, \" Mark Manson says. \"Let\'s be honest, shit is f**ked and we have to live with it.\" In his wildly popular Internet blog, Mason doesn\'t sugarcoat or equivocate. He tells it like it is? dose of raw, refreshing, honest truth that is sorely lacking today. The Subtle Art of Not Giving a F**k is his antidote to the coddling, let\'s-all-feel-good mindset that has infected American society and spoiled a generation, rewarding them with gold medals just for showing up. \r\nManson makes the argument, backed both by academic research and well-timed poop jokes, that improving our lives hinges not on our ability to turn lemons into lemonade, but on learning to stomach lemons...\r\n', NULL, NULL, '2025-11-05 03:50:05', ''),
